        <style>
            .preloader {
                position: absolute;
                top: 0;
                left: 0;
                width: 100vw!important;
                height: 100vh!important;
                z-index: 19999;
                overflow: hidden;
                user-select: none
            }

            .preloader__luna__logo {
                position: absolute;
                top: 82.6%;
                transform: translate(-50%,-50%);
                left: 50%;
                width: 100px;
                height: 100px;
                max-width: 10vmax;
                max-height: 10vmax;
                display: flex;
                justify-content: center;
                align-items: center
            }

            .preloader__luna__logo * {
                max-width: 100%;
                max-height: 100%
            }

            .preloader__background__color__overlay {
                position: absolute;
                background-color: #914afa;
                width: 100%;
                height: 100%;
                z-index: -1
            }

            @media (orientation: portrait) {
                .preloader__background__shape1 {
                    position:absolute;
                    width: 1500px;
                    height: 29vh;
                    left: -50px;
                    top: -220px;
                    transform: rotateZ(-30deg);
                    border-radius: 10000px;
                    background-color: rgba(255,255,255,.1);
                    z-index: 2
                }

                .preloader__background__shape2 {
                    position: absolute;
                    width: 1900px;
                    height: 54vh;
                    transform: rotateZ(15deg);
                    bottom: -35vh;
                    left: -43vh;
                    border-radius: 10000px;
                    background-color: rgba(255,255,255,.1);
                    z-index: 2
                }

                .preloader__wrapper {
                    width: 100%;
                    height: 100%;
                    display: flex;
                    flex-direction: column;
                    align-items: center;
                    justify-content: center;
                    opacity: 1;
                    z-index: 1
                }

                .wrapper {
                    margin-bottom: 3.5vmax;
                    text-align: center
                }
            }

            @media (orientation: landscape) {
                .preloader__background__shape1 {
                    position:absolute;
                    width: 1500px;
                    height: 28vmax;
                    top: -350px;
                    left: 250px;
                    transform: rotateZ(-25deg);
                    border-radius: 10000px;
                    background-color: rgba(255,255,255,.1);
                    z-index: 2
                }

                .preloader__background__shape2 {
                    position: absolute;
                    width: 2000px;
                    height: 35vmax;
                    transform: rotateZ(15deg);
                    bottom: -25vw;
                    left: -50%;
                    border-radius: 10000px;
                    background-color: rgba(255,255,255,.1);
                    z-index: 2
                }

                .preloader__wrapper {
                    width: 100%;
                    height: 100%;
                    display: flex;
                    flex-direction: column;
                    align-items: center;
                    justify-content: center;
                    opacity: 1;
                    z-index: 1;
                    margin-top: -2vmax
                }

                .wrapper {
                    margin-bottom: 3.5vmin;
                    text-align: center
                }
            }

            .preloader__container {
                position: relative;
                display: flex;
                align-items: center;
                justify-content: center;
                width: 13vmax;
                height: 1.8vmax
            }

            .preloader__outer__bar {
                display: flex;
                justify-content: left;
                align-items: center;
                width: 100%;
                height: 1.2vmax;
                margin: .4vmax;
                border-radius: 1000px
            }

            .preloader__outer__bar:before {
                content: '';
                position: absolute;
                border: .3vmax solid #fff;
                top: 0;
                bottom: 0;
                left: 0;
                right: 0;
                border-radius: 100vh
            }

            .preloader__bar {
                width: 0%;
                height: calc(100% - .4vmax);
                margin: .2vmax;
                border-radius: 10000px;
                box-sizing: border-box;
                background: #fff;
                animation: loading 8s forwards
            }

            .preloader__icon {
                width: 15vmax;
                height: 15vmax;
                border-radius: 25%;
                z-index: 3
            }

            .preloader__name {
                font-size: 2vmax;
                font-weight: 700;
                font-family: Helvetica,sans-serif;
                color: #fff;
                text-align: center;
                margin-left: 20px;
                margin-right: 20px
            }

            @keyframes loading {
                0% {
                    width: 0%
                }

                100% {
                    width: calc(100% - .4vmax)
                }
            }
        </style>
